import NavBar from "./components/nav/nav";
import StockCard from "./components/products/StockCard";
import {Switch,BrowserRouter as Router,Route} from "react-router-dom"
function App(){
    return (
        <>  
            <NavBar/>
            <StockCard/>
            <Router>
                <Switch>
                    <Route exact to="/addstocks">
                        <h1>addstocks</h1>
                    </Route>
                </Switch>
            </Router>
        </>
    )
}
export default App;
